import { Fullpage, Slide } from "react-full-page";

function Home () {
  return (
    <S.Container>
      <S.HomeTitle>당신의 다음 레벨을 확인하세요</S.HomeTitle>
      <div></div>
    </S.Container>
  )
}

export default Home;
